import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from "./components/Header";
// import Home from './components/Home/Home';
// import Jaipur from './components/Jaipur/Jaipur';
// import Mumbai from './components/Mumbai/Mumbai';
// import Goa from './components/Goa/Goa';

const LazyHome = React.lazy(()=> import('./components/Home/Home'));
const LazyJaipur = React.lazy(()=> import('./components/Jaipur/Jaipur'));
const LazyMumbai = React.lazy(()=> import('./components/Mumbai/Mumbai'));
const LazyGoa = React.lazy(()=> import('./components/Goa/Goa'));

function App() {
  return (
    <div className="App">
      <Router>
        <React.Suspense fallback="Loading">
        <Header/>
        <Routes>
            <Route exact path="/" element={<LazyHome />} />
            <Route exact path="/jaipur" element={<LazyJaipur/>} />
            <Route exact path="/mumbai" element={<LazyMumbai/>} />
            <Route exact path="/goa" element={<LazyGoa/>} />
        </Routes>
        </React.Suspense>
      </Router>
    </div>
  );
}
export default App;
